import React from 'react';
import { AiOutlineSearch } from 'react-icons/ai';

import useStyles from './styles'



function SearchBox() {
  const classes = useStyles();


  return (
    <form>
        <input type='text' />
        <button type='submit'><AiOutlineSearch /></button>
    </form>
  );
}

export default SearchBox;
